css:
@-moz-document domain('tumblr.com'), url-prefix('http://www.tumblr.com/') {















#dashboard_index{background:#660044 url(http://i54.tinypic.com/iyfu6b.png) repeat !important;}























#left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {background-color:#660044!important;transparent;}















ol#posts li.notification{background-color: #000000!important;







border-bottom: 1px solid #000000!important;







color: #660044!important;}















#left_column .dashboard_options_form {







   background: url('http://assets.tumblr.com/images/white_20.png')#000000;







}















#right_column a#dashboard_switch_blog_menu_current:hover {







   background: #ffffff;







}

#right_column #dashboard_switch_blog_arrow_current{



    display:none !important;



}



















#nav .nav_item.active{







   background-color:#660044







}















#left_column #posts .post .permalink{







   background-color:#ffffff;







}















#nav .nav_item.active, #nav .nav_item .nav_menu, #nav .nav_item .nav_item_nipple .nav_item_nipple_pixel{







   background-color:#660044;







}















}

@-moz-document url-prefix('http://www.tumblr.com/reblog/') {







#left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {



    padding: 40px 0;



  }







}







